def approxMatch(p,t,d):
    appatern = ''
    for i in range(0, len(t)-len(p)):
        mismatch = 0
        for j in range(0, len(p)):
            if p[j] != t[i+j]:
                mismatch += 1
        if mismatch <= d:
            appatern = appatern + str(i) + ' '
    return appatern

p = 'TTTACATGACC'
t = ''
d = 6
print(approxMatch(p,t,d))